import RequestReset from "../components/RequestReset";

export default function ResetPage({query}){   
    if(!query?.token){
        return  <div> 
            <p>Sorry you must supply a token</p>;
            <RequestReset/>
            </div>
    }

    return (
        <div>
        <p>Reset Your password! {query.token}</p>
        </div>
    )
}
